import SideBar from "./SideBar1";
import Navbar from "./Navbar";
import { Outlet } from "react-router-dom";

function Main() {
  return (
    <div className="layout">
      <SideBar />

      <div className="main-section">
        <Navbar />
        <div className="content">
          <Outlet />
        </div>
      </div>
    </div>
  );
}

export default Main;
